import { BrowserRouter as Router }  from 'react-router-dom';
import './App.css';
import Footer from './components/Footer';
import Home from './components/Home';
import Navbar from './components/Navbar';

function App() {
  return (
    <Router>
       <Navbar />
       <Home />
       <Footer />

    </Router>
  );
}

export default App;
